import React, { useState } from "react";

const Amojonamientos = () => {

  const [activeSection, setActiveSection] = useState(null);

  const handleSectionToggle = (section) => {
    setActiveSection((prev) => (prev === section ? null: section));
  }

  return (
    <div className="d-flex justify-content-center align-items-center vh-100 bg-success">
      <div
        className="card p-4 p-md-2 shadow-lg text-center"
        style={{
          width: "100%",  // Esto asegura que el contenedor ocupe todo el ancho disponible en pantalla.
          height: "90vh", // La altura sigue siendo un porcentaje de la altura del viewport.
          maxWidth: "1200px", // Mantiene la proporción del contenedor sin que se estire más allá de este ancho
          borderRadius: "20px",
          overflow: "hidden",
        }}
      >
        {/* Header */}
        <div className="d-flex justify-content-between align-items-center mb-3">
          <img
            src="/images/logosdc.jpg"
            alt="Logo SDC"
            style={{
              width: "100px",
              height: "100px",
              borderRadius: "50%",
            }}
          />
          <h1
            className="flex-grow-1 text-black text-center m-0"
            style={{
              fontSize: "24px",
            }}
          >
            Progreso
          </h1>
          <i
            className="fas fa-bars"
            style={{
              fontSize: "30px",
            }}
          ></i>
        </div>

        {/* Contenedor con scroll horizontal */}
        <div
          className="overflow-auto"
          style={{
            maxHeight: "75vh", // Se mantiene la altura máxima para el scroll vertical si es necesario
            overflowX: "auto", // Permite el desplazamiento horizontal si el contenido excede el contenedor
            whiteSpace: "nowrap", // Evita que el contenido se rompa en varias líneas
            paddingRight: "10px",
          }}
        >
        {/* Secciones con encabezados */}
        <div className="list-group">
          {/* Por hacer */}
          <div>
            <div
              className="list-group-item bg-danger text-white"
              onClick={() => handleSectionToggle("porHacer")}
              style={{ cursor: "pointer" }}
            >
              Por hacer
            </div>
            {activeSection === "porHacer" && (
              <div className="bg-light p-3">
                <p>Contenido de la tabla "Por hacer".</p>
              </div>
            )}
          </div>

          {/* En Progreso */}
          <div>
            <div
              className="list-group-item bg-warning text-dark"
              onClick={() => handleSectionToggle("enProgreso")}
              style={{ cursor: "pointer" }}
            >
              En Progreso
            </div>
            {activeSection === "enProgreso" && (
              <div className="bg-light p-3">
                <p>Contenido de la tabla "En Progreso".</p>
              </div>
            )}
          </div>

          {/* Por cobrar */}
          <div>
            <div
              className="list-group-item bg-info text-white"
              onClick={() => handleSectionToggle("porCobrar")}
              style={{ cursor: "pointer" }}
            >
              Por cobrar
            </div>
            {activeSection === "porCobrar" && (
              <div className="bg-light p-3">
                <p>Contenido de la tabla "Por cobrar".</p>
              </div>
            )}
          </div>

          {/* Para facturar */}
          <div>
            <div
              className="list-group-item bg-success text-white"
              onClick={() => handleSectionToggle("paraFacturar")}
              style={{ cursor: "pointer" }}
            >
              Para facturar
            </div>
            {activeSection === "paraFacturar" && (
              <div className="bg-light p-3">
                <p>Contenido de la tabla "Para facturar".</p>
              </div>
            )}
          </div>

          {/* Facturado */}
          <div>
            <div
              className="list-group-item bg-primary text-white"
              onClick={() => handleSectionToggle("facturado")}
              style={{ cursor: "pointer" }}
            >
              Facturado
            </div>
            {activeSection === "facturado" && (
              <div className="bg-light p-3">
                <p>Contenido de la tabla "Facturado".</p>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
    </div>
  );
};

export default Amojonamientos;
